import React, { Component } from 'react'
import hay from '../../../assets/DR_Prop_HayBaleRectangle_0001.png'
import fenceV from '../../../assets/DR_Prop_Fence_Pieces_0001.png'
import fenceH from '../../../assets/DR_Prop_Fence_Pieces_00021.png'
import BBB from '../../../assets/DR_Baby_Brontosaurus_0001.png'
class YTPlaylist extends Component {

  render(){
    return(
      <main className="yt_playlist">
        {/* <div className="top-border"></div> */}
        <aside className="yt-aside-group">
          <img src={hay} className="hay" alt=""/>
          <img src={BBB} className="bbb" alt="" />
        </aside>
        {/* <div  className="fenceV" alt=""/> */}
        <aside className="yt-content">
          <div className="h2-shadow">Let's Saddle Up!</div>
          <h2>Let's Saddle Up!</h2>
          <iframe className="playlist-frame" width="854" height="480" src="https://www.youtube.com/embed/videoseries?list=PLFn4dkBSmLS3yXEJXQjvAGP0kV92KAJtq" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </aside>
        {/* <div className="fenceH" alt="" /> */}
        {/* <img src={fenceV} className="fenceVB" alt="" /> */}
      </main>
    )
  }
}
export default YTPlaylist
